import cleaning from "../assets/services/cleaning.jpg";
import rootCanal from "../assets/services/rootcanal.jpg";
import braces from "../assets/services/braces.jpg";
import implants from "../assets/services/implants.jpg";
import cosmetic from "../assets/services/cosmetics.jpg";
import emergency from "../assets/services/emergency.jpg";

export default function Services() {
  return (
    <section className="services" id="services">
      {/* IMAGES GRID FIRST */}
      <div className="services-grid">
        <div className="service-card">
          <img src={cleaning} alt="Teeth Cleaning" />
          <p>Teeth Cleaning</p>
        </div>

        <div className="service-card">
          <img src={rootCanal} alt="Root Canal Treatment" />
          <p>Root Canal Treatment</p>
        </div>

        <div className="service-card">
          <img src={braces} alt="Braces & Orthodontics" />
          <p>Braces & Orthodontics</p>
        </div>

        <div className="service-card">
          <img src={implants} alt="Dental Implants" />
          <p>Dental Implants</p>
        </div>

        <div className="service-card">
          <img src={cosmetic} alt="Cosmetic Dentistry" />
          <p>Cosmetic Dentistry</p>
        </div>

        <div className="service-card">
          <img src={emergency} alt="Emergency Dental Care" />
          <p>Emergency Dental Care</p>
        </div>
      </div>

      {/* HEADING BELOW IMAGES */}
      <h2 className="services-heading">Our Services</h2>
    </section>
  );
}
